- input: 'TEXT,F3XA,,"The Arizona Democratic Party''s established procedure for obtaining
    Best Efforts is as follows:    1) Original solicitations for fundraising receptions
    or direct mail solicitation for funds include contribution cards that clearly
    request and explain that federal law requires us to request and report the required
    information.    2) At the reception when checks are received contributors are
    asked to fill out contribution cards that requests and explains that federal law
    requires us to request and report the required information.    3) Arizona fundraising
    staff then follows up on contributions that are in excess of $200 by phone prior
    to the filing of each monthly report with a list provided by the Compliance Department
    and information obtained is reported on that report.   4) Finally every 60 days
    the Compliance Department sends a letter which includes a pre-addressed stamped
    return envelope and form that  clearly asks for the missing information.  If information
    is provided after the reporting period and the contributor will not appear on
    the next regularly scheduled report; amendments to the report originally disclosing
    the contribution will be filed.     ------     Regarding the commissions question
    regarding voter identification.  -  After carefully reviewing the definitions
    of Federal Election Activity in 11 CFR 100.24(b) and further consultation from
    our Campaign Finance Law attorney''s we have determined that the disbursements
    in question on this report do not meet the definitions of Federal Election Activity.  ",'
